int test_finitel(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(finitel_vec)/sizeof(finitel_vec[0]); i++) {
        long long y = finitel(finitel_vec[i].x);
        result += check_long_long("finitel", finitel_vec[i].line, finitel_vec[i].y, y);
    }
    return result;
}
