int test_atan2l(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(atan2l_vec)/sizeof(atan2l_vec[0]); i++) {
        long double y = atan2l(atan2l_vec[i].x0, atan2l_vec[i].x1);
        result += check_long_double("atan2l", atan2l_vec[i].line, ATAN2L_PREC, atan2l_vec[i].y, y);
    }
    return result;
}
