int test_fmodl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(fmodl_vec)/sizeof(fmodl_vec[0]); i++) {
        long double y = fmodl(fmodl_vec[i].x0, fmodl_vec[i].x1);
        result += check_long_double("fmodl", fmodl_vec[i].line, FMODL_PREC, fmodl_vec[i].y, y);
    }
    return result;
}
