int test_fmaxl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(fmaxl_vec)/sizeof(fmaxl_vec[0]); i++) {
        long double y = fmaxl(fmaxl_vec[i].x0, fmaxl_vec[i].x1);
        result += check_long_double("fmaxl", fmaxl_vec[i].line, FMAXL_PREC, fmaxl_vec[i].y, y);
    }
    return result;
}

