int test_hypotl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(hypotl_vec)/sizeof(hypotl_vec[0]); i++) {
        long double y = hypotl(hypotl_vec[i].x0, hypotl_vec[i].x1);
        result += check_long_double("hypotl", hypotl_vec[i].line, HYPOTL_PREC, hypotl_vec[i].y, y);
    }
    return result;
}

