int test_scalbl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(scalbl_vec)/sizeof(scalbl_vec[0]); i++) {
        long double y = scalbl(scalbl_vec[i].x0, scalbl_vec[i].x1);
        result += check_long_double("scalbl", scalbl_vec[i].line, SCALBL_PREC, scalbl_vec[i].y, y);
    }
    return result;
}
