int test_copysignl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(copysignl_vec)/sizeof(copysignl_vec[0]); i++) {
        long double y = copysignl(copysignl_vec[i].x0, copysignl_vec[i].x1);
        result += check_long_double("copysignl", copysignl_vec[i].line, COPYSIGNL_PREC, copysignl_vec[i].y, y);
    }
    return result;
}

