int test_cosl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(cosl_vec)/sizeof(cosl_vec[0]); i++) {
        long double y = cosl(cosl_vec[i].x);
        result += check_long_double("cosl", cosl_vec[i].line, COSL_PREC, cosl_vec[i].y, y);
    }
    return result;
}
