int test_expm1l(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(expm1l_vec)/sizeof(expm1l_vec[0]); i++) {
        long double y = expm1l(expm1l_vec[i].x);
        result += check_long_double("expm1l", expm1l_vec[i].line, EXPM1L_PREC, expm1l_vec[i].y, y);
    }
    return result;
}
