int test_floorl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(floorl_vec)/sizeof(floorl_vec[0]); i++) {
        long double y = floorl(floorl_vec[i].x);
        result += check_long_double("floorl", floorl_vec[i].line, FLOORL_PREC, floorl_vec[i].y, y);
    }
    return result;
}

