int test_nearbyintl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(nearbyintl_vec)/sizeof(nearbyintl_vec[0]); i++) {
        long double y = nearbyintl(nearbyintl_vec[i].x);
        result += check_long_double("nearbyintl", nearbyintl_vec[i].line, NEARBYINTL_PREC, nearbyintl_vec[i].y, y);
    }
    return result;
}

