int test_truncl(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(truncl_vec)/sizeof(truncl_vec[0]); i++) {
        long double y = truncl(truncl_vec[i].x);
        result += check_long_double("truncl", truncl_vec[i].line, TRUNCL_PREC, truncl_vec[i].y, y);
    }
    return result;
}
